//Check for an item being used
function useItem(x,y,z,itemId,blockId,side){
	if(itemId == structureSelectorId){
		housesGUI()
	}
	if(itemId == structureBuilderId){
		if(firstStructure == null && structure != null){
			var X=[x]
			var X2=[x]
			var Y=[y]
			var Y2=[y]
			var Z=[z]
			var Z2=[z]
			var I=[getTile(x,y,z)]
			var D=[Level.getData(x,y,z)]
			for(n=0;n<1+1;n++){
				setTile(X[n], Y[n], Z[n], 2);
			}
			setTile(X2[0],Y2[0],Z2[0],I[0],D[0])
			firstStructure = 1
		}
		if(structure == null) clientMessage("Please select a structure using the X-Strcuture - Zeppelin1")
        else if(structure == 1) Zeppelin1GUI(x,y,z)
        else if(structure == 2) Zeppelin2GUI(x,y,z)
        else if(structure == 3) Zeppelin3GUI(x,y,z)
        else if(structure == 5) Zeppelin4GUI(x,y,z)
        else if(structure == 6) Zeppelin5GUI(x,y,z)
        else if(structure == 7) Zeppelin6GUI(x,y,z)
        else if(structure == 8) Zeppelin7GUI(x,y,z)
        else if(structure == 9) Zeppelin9GUI(x,y,z)
        else if(structure == 10) Zeppelin10GUI(x,y,z)
        else if(structure == 11) Zeppelin11GUI(x,y,z)
 	}
}

